import render from "@testing-library/react";
import React from "react";
import ReactDOM from "react-dom";
import blogger from "./blogger";

function App(){

    return <div>
        <h1>Hello World</h1>
        <h2>this is {blogger.name}</h2>
    </div>
}

ReactDOM.render(<App />, document.getElementById("Index"));
